import axios from 'axios';

export const API_DEFAULT_PARAMS = {
         per_page: 30,
         client_id:
           'add7029af557a934c8737dd2594d2345a4ae37d1bf154e524df5f07d9054daf2'
       };

export default axios.create({
  baseURL: 'https://api.unsplash.com/',
  headers: {
    Authorization:
      'Client-ID '
  }
});
